import React from 'react'
import { useState } from 'react'

export default function Interest() {
  const [int,setInt]=useState(["Web Development","App Development","Coding"]);
  return (
    <div>
        <h1>Interest</h1>
        <ul>
        <li>Web Development</li>
        <li>App Development</li>
        <li>Coding</li>
      </ul>
    </div>
  )
}
